import React from 'react';
import './NavTab.css';

function NavTab() {
    <div className="nav">
        <nav className="nav__items">
            <p className="nav__item">О проекте</p>
            <p className="nav__item">Технологии</p>
            <p className="nav__item">Студент</p>
        </nav>
    </div>
}

export default NavTab;
